import styles from './home.module.scss';
import className from 'classnames/bind';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faClock, faUser, faUserCircle } from '@fortawesome/free-regular-svg-icons';
import { faChartSimple, faHouse, faPeopleGroup, faUserAlt } from '@fortawesome/free-solid-svg-icons';
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import banner1 from '~/assets/img/banner1.jpg';

const cx = className.bind(styles);

function Home() {
    let navigate = useNavigate();
    function DashBoard() {
        navigate('/dashboard');
    }
    function User() {
        navigate('/user');
    }

    return (
        <div className={cx('home')}>
            <div className={cx('header')}>
                <div className={cx('header_logo')}>
                    <FontAwesomeIcon className={cx('clock_icon')} icon={faClock} />
                    <h1 className={cx('logo_h1')}> Smart Water Meter</h1>
                </div>
                <div className={cx('header_menu')}>
                    <ul className={cx('menu_nav')}>
                        <li className={cx('menu_li')}>
                            <FontAwesomeIcon className={cx('icon_li')} icon={faHouse} />
                            <a className={cx('li_a')}>Home</a>
                        </li>
                        <li onClick={DashBoard} className={cx('menu_li')}>
                            <FontAwesomeIcon className={cx('icon_li')} icon={faChartSimple} />
                            <a className={cx('li_a')}>Dashboard</a>
                        </li>
                        <li className={cx('menu_li')}>
                            <FontAwesomeIcon className={cx('icon_li')} icon={faPeopleGroup} />
                            <a className={cx('li_a')}>Team</a>
                        </li>
                        <li onClick={User} className={cx('menu_li_user')}>
                            <FontAwesomeIcon className={cx('icon_li')} icon={faUserAlt} />
                            <a className={cx('li_a')}>User</a>
                            <ul className={cx('user_menu')}>
                                <li>
                                    <a className={cx('li_a_sub')}>User</a>
                                </li>
                                <li>
                                    <a className={cx('li_a_sub')}>Logout</a>
                                </li>
                            </ul>
                        </li>
                    </ul>
                </div>
            </div>
            <div className={cx('content')}>
                <div className={cx('main_content')}>
                    <div className={cx('content_banner')}>
                        <img
                            src={banner1}
                            style={{
                                borderRadius: '8px',
                                width: '100%',
                            }}
                        />
                        <div className={cx('main_introduce')}>
                            <div className={cx('introduce_content')}>
                                <h2>What is a smart water meter?</h2>
                                <p>
                                    A smart water meter works in the same way as a traditional water meter in that it
                                    monitors the flow of water into your business or building. However smart water
                                    meters have many advantages including real time data, wireless technology, smart
                                    water analytics, actionable insights and eliminates manual readings. Hospitality or
                                    any commercial business can easily track their water usage and costs in real time
                                    using these features. In this we will outline a detailed comparison on water
                                    loggers, water meters and the difference between utility meters, AMR and the latest
                                    AI powered smart water meter.
                                </p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            <div className={cx('footer')}></div>
        </div>
    );
}
export default Home;
